// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

    import "@openzeppelin/contracts/utils/Strings.sol";

contract SimpleNFT {

    using Strings for uint256;

    mapping (uint=> address) private _owners;

    mapping (address => mapping(address=> bool)) private _operatorAdd;

    string baseURL = "http://example.com/images";

    // Mint Tokens
    function mint (uint256 _tokenId) external {
        require(_owners[_tokenId]== address(0), "Already Minted");
        require(_tokenId<100, "Token Id is too Large");
        _owners[_tokenId] = msg.sender;
    }

    function ownerOf(uint256 _tokenId) external view returns (address) {
        require(_owners[_tokenId] != address(0), "No such token");
        return _owners[_tokenId];
    }

    //Transfer NFT
    function transferFrom(address _from, address _to, uint256 _tokenId) public {
        require (_owners[_tokenId]!= address(0), "Token is not yours") ;
        require(_owners[_tokenId] == _from, "Cannot Transfer");
        require(msg.sender == _from || _operatorAdd[_from][msg.sender], "Require the Owner");

        _operatorAdd[_from][msg.sender]=false;
        _owners[_tokenId]=_to;
    }

    function tokenURI(uint256 _tokenId) external view returns (string memory){
        require(_owners[_tokenId] != address(0), "Does not exist"); 

            return string(abi.encodePacked(baseURL, _tokenId.toString(), ".jpeg"));
    }

//Approval
    function setApprovalForAll(address _operator, bool _approved) external {
        _operatorAdd[msg.sender][_operator]= _approved;

    }

}

